import React, { useEffect } from 'react';
import { useAuth0 } from '@auth0/auth0-react';

function Profile(props) {
  useEffect(() => {
    //...
  });
  console.log(props);

  return (
    <div>
      <h2>Hello {props.user.name}</h2>
      <div>
        <img
          style={{ width: '50px', borderRadius: '50%' }}
          src={props.user.picture}
          alt="profile-picture"
        />
      </div>
    </div>
  );
}

export default Profile;
